package ko222gj_assign3;

public class FractionMain {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Fraction f = new Fraction(-2, 1);
		System.out.println(f.isEqualTo(5, 1));
		System.out.println(f.isNegative());
		System.out.println(f.add(100, 5));
		System.out.println(f.subtract(3, 2));
		System.out.println(f.multiply(1, 2));
		System.out.println(f.divide(5, 1));

	}

}
